import React from "react";
import logo from '../images/logo.png';
import classes from "./Header.module.css";
const Header = () => {
    return <nav class="navbar navbar-expand-lg navbar-light nav">
    <p className={`navbar-brand ${classes.nav_icon}`} href="/">
        <img src={logo} alt="logo"/>
    </p>
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link text-white" href="/">Thông điệp</a>
        </li>
        <li class="nav-item">
            <a class="nav-link text-white" href="/thongke">Thống kê</a>
          </li>
      </ul>
    </nav>
}
export default Header;
